import React,{Component} from 'react';
import './Search.css'
class Searchnew extends Component
{ 
    constructor(props)
    {

   super(props)

   this.state={


      str:'',
      'output':[]

   } 
   this.searchHandler=this.searchHandler.bind(this)
}
handlestr=(event)=>
{
this.setState({  
  [event.target.name]:event.target.value


})
}
searchHandler=(event)=>
{  


 if(this.state.str==="Traffic"||this.state.str==="traffic"||this.state.str==="Accident"||this.state.str==="accident"||this.state.str==="Hazard"||this.state.str==="hazard")
 {
  var body={
    str:this.state.str
  }


  const url = "http://localhost:9000/incidents/findbyt/"+this.state.str;
  console.log(body)
  let headers=new Headers();
  headers.append('Content-Type','application/json');
  headers.append('Accept','application/json');
  headers.append('Access-control-Allow-origin',url);
  headers.append('Access-control-Allow-Credentials','true');
  headers.append('POST','GET');
  fetch(url, {
    headers: headers,
    method: 'GET',

  })


  .then(response => response.json()) 
  .then(contents => {
    console.log(contents);

  })

  .catch(() => console.log("can't access " + url + " response. "))
 }


 else{

  const url = "http://localhost:9000/incidents/findbyl/"+this.state.str;

  let headers=new Headers();
  headers.append('Content-Type','application/json');
  headers.append('Accept','application/json');
  headers.append('Access-control-Allow-origin',url);
  headers.append('Access-control-Allow-Credentials','true');
  headers.append('POST','GET');
  fetch(url, {
    headers: headers,
    method: 'GET',
    body: JSON.stringify(body)
  })


    .then(response => response.json())
    .then(contents => {
      console.log(contents);

    })
    .catch(() => console.log("can't access" + url + "response. "));

 }

}
/*renderlist(incident)
 {
    return  this.state.output.map(function(item){ 
        console.log("in render list" + incident);
        return (
            <h1>{item.damages}</h1>
        )
  })
 }
 */

render()
{
    return(
        <div className='Search-container'>
        <div style={{margin:'20px 20%'}}>
            <h1>Incident Search</h1>
           <input type="search" placeholder='Search..' name="str" value={this.state.str}  onChange={this.handlestr}></input>
        </div>
        <table>
            <tbody>
            <tr>
            <th>INCIDENT_ID</th>
            <th>DEVICE_ID</th>
            <th>INCIDENT TYPE</th>
            <th>SUB-TYPE</th>
            <th>SEVERITY LEVEL</th>
            <th>DAMAGES</th>
            <th>DESCRIPTION</th>
            <th>Reporting_Time</th>
            <th>UPVOTE</th>
            <th>DOWNVOTE</th>
            <th>COUNT</th>
            </tr>

            {
                output.map(item =>{
                    return(
                        <React.Fragment key={item.incidentId}>
                        <tr>
                            <td>{item.incidentId}</td>
                            <td>{item.deviceId}</td>
                            <td>{item.incidentType}</td>
                            <td>{item.subtype}</td>
                            <td>{item.severityLevel}</td>
                            <td>{item.damages}</td>
                            <td>{item.addInfo}</td>
                            <td>{item.location}</td>
                            <td>{item.timeStamp}</td>
                            <td>{item.upvote}</td>
                            <td>{item.downvote}</td>
                            <td>{item.reportCount}</td>
                            <button onClick={this.searchHandler}>search</button>
                        </tr>
                        </React.Fragment>
                    )
                })
            }

           </tbody>
        </table>
    </div>
    )
}

}


export default Searchnew;
